            <img src={Logo} alt="" />
            <ul className={clsx(style.navitem)}>
                <li><NavLink


                 className={({isActive})=>(isActive && true ? clsx(style.active) : clsx(style.navlink) )}
                  to='/'>Home 
                 </NavLink></li>
                <li><NavLink
